import React, { Component } from 'react'
import Item from '../Item'
import './index.css'
export default class index extends Component {
  render() {
    // console.log(this.props);
    return (
      <ul className="todo-main">
        {
          this.props.hobbies.map((item) => {
            return <Item key={item.id} {...item} />
          })

        }
      </ul>
    )
  }
}
